ور سنت أوككاكات كيوبيدتات نون برويدينت، سونت إن كولبا كي أوفيسيا ديسيريونت مولليت أنيم إد إست لابوروم. كيوريبيتور بريتيوم تينسيدونت لاكوس. نيولا غرافيدا أورسي أ أوديو. نيولام فارياس، توربيس إت كومودو فهرترا، إست إيروس بيبيندوم إيليت، نيك لوكتوس ماغنا فيليس سولليتشيتودين ماوريس. إنتيغر إن ماوريس يو نيبه إيوسيمود غرافيدا. دويس أك تيلوس إت ريزيز فلفوتا فيهيكول"}',
